
              <!DOCTYPE html>
                <html lang="uz">
                <head>
                    <meta charset="UTF-8">
                    <meta name="viewport" content="width=device-width, initial-scale=1.0">
                    <title>Tezkor Quiz</title>
                    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css">
                    
                <style>
                    * {
                        margin: 0;
                        padding: 0;
                        box-sizing: border-box;
                    }

                    body {
                        font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
                        background: #f8f9fa;
                        color: #333333;
                        line-height: 1.6;
                        min-height: 100vh;
                        display: flex;
                        justify-content: center;
                        align-items: center;
                        padding: 2rem;
                    }

                    .profile-card {
                        background: #ffffff;
                        border-radius: 20px;
                        padding: 2rem;
                        box-shadow: 0 10px 40px rgba(0,0,0,0.1);
                        border: 1px solid #e1e5e9;
                        text-align: center;
                        max-width: 400px;
                        width: 100%;
                    }

                    .profile-header {
                        margin-bottom: 2rem;
                    }

                    .profile-avatar {
                        width: 120px;
                        height: 120px;
                        border-radius: 50%;
                        background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
                        display: flex;
                        align-items: center;
                        justify-content: center;
                        color: white;
                        font-size: 3rem;
                        font-weight: bold;
                        margin: 0 auto 1rem;
                        box-shadow: 0 5px 20px rgba(0,0,0,0.2);
                        overflow: hidden;
                    }

                    .profile-avatar img {
                        width: 100%;
                        height: 100%;
                        object-fit: cover;
                    }

                    .profile-name {
                        font-size: 1.8rem;
                        font-weight: bold;
                        color: #333333;
                        margin-bottom: 0.5rem;
                    }

                    .profile-bio {
                        color: #666666;
                        margin-bottom: 2rem;
                        line-height: 1.5;
                    }

                    .social-icons {
                        display: flex;
                        justify-content: center;
                        gap: 1rem;
                        margin-bottom: 2rem;
                        flex-wrap: wrap;
                    }

                    .social-link {
                        width: auto;
                        padding: 0.5rem 1rem;
                        border-radius: 15px;
                        display: flex;
                        align-items: center;
                        justify-content: center;
                        color: white;
                        background: #000000;
                        text-decoration: none;
                        font-size: 1rem;
                        transition: all 0.3s ease;
                        box-shadow: 0 3px 10px rgba(0,0,0,0.2);
                    }

                    .social-link i {
                        margin-right: 0.5rem;
                    }

                    .social-link:hover {
                        transform: translateY(-3px);
                        box-shadow: 0 5px 20px rgba(0,0,0,0.3);
                    }

                    .profile-links {
                        display: flex;
                        flex-direction: column;
                        gap: 1rem;
                    }

                    .profile-link {
                        background: #ffffff;
                        border: 2px solid #e1e5e9;
                        color: #333333;
                        padding: 1rem;
                        border-radius: 15px;
                        text-decoration: none;
                        font-weight: 600;
                        transition: all 0.3s ease;
                        display: flex;
                        align-items: center;
                        justify-content: center;
                        gap: 0.5rem;
                    }

                    .profile-link:hover {
                        background: #667eea;
                        color: white;
                        transform: translateY(-2px);
                        box-shadow: 0 5px 15px rgba(0,0,0,0.2);
                    }

                    .share-btn {
                        background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
                        color: white;
                        border: none;
                        padding: 1rem 2rem;
                        border-radius: 15px;
                        cursor: pointer;
                        font-weight: 600;
                        font-size: 1.1rem;
                        margin-top: 2rem;
                        width: 100%;
                        transition: all 0.3s ease;
                    }

                    .share-btn:hover {
                        transform: translateY(-2px);
                        box-shadow: 0 5px 20px rgba(0,0,0,0.3);
                    }
                </style>
